import React, { Component } from 'react'

export default class UserControl extends Component {
  render() {
    return (
      <div>
        <box className="userControl" style={{
          color: 'white',
          position: 'fixed',
          top: '0',
          left: '370',
          height: '100vh',
          width: '320px',
          backgroundColor: '#308efe',
          border: '10px',
        }}>User List</box>
      </div>
    )
  }
}
